window.bookSummaryJSON = "Never has the subject of men's health attracted more attention than in this era of optimal living. In this revised and updated edition of <i>Men's Private Parts: A Pocket Reference to Prostate, Urologic, and Sexual Health</i>, the author, known for years to readers of the <i>Men's Health</i> newsletter as \"Dr. Private Parts\", tackles men's most delicate health questions with reassuring authority. <p> Dr. James H. Gilbaugh, Jr., a board-certified urologist and fellow of the American College of Surgeons with 25 years of clinical practice, presents the latest medical information for men in a straightforward, friendly, and accessible style. In addition to putting locker-room misconceptions to rest he offers plain explanations of the workings of the unique male system and the best, most up-to-date medical advice.</p> <p> Listeners will be able to recognize and anticipate potential problems and know when to seek a doctor's instruction. <i>Men's Private Parts</i> addresses some of the most difficult and embarrassing questions men are unable to ask on their own and provides solutions and remedies to many problems.</p>"; 
